import React, { useState, useEffect } from "react";
import { Form, Button, Container, Table } from "react-bootstrap";
import axios from "axios";

function ResultScreen() {
  const [searchSystem, setSearchSystem] = useState("Google");
  const [resp, setResp] = useState([]);

  const onSearchSystemChange = (e) => {
    setSearchSystem(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    axios
      .get(
        `http://127.0.0.1:8000/api/tasks_ready?search_system=${searchSystem}`
      )
      .then((res) => setResp(JSON.parse(res.request.response)))
      .catch((err) => console.log(err));
  };

  return (
    <div className="result-form">
      <h1>Create Task</h1>
      <Container>
        <Form onSubmit={handleSubmit}>
          <Form.Group controlId="formSearchSystem">
            <Form.Label>Select Search System</Form.Label>
            <Form.Control
              as="select"
              value={searchSystem}
              required
              onChange={onSearchSystemChange}
            >
              <option>Google</option>
              <option>Bing</option>
              <option>Yahoo</option>
              <option>Yandex</option>
              <option>Baidu</option>
              <option>Naver</option>
            </Form.Control>
            {/* <Form.Text className="text-muted">
              We'll never share your email with anyone else.
            </Form.Text> */}
          </Form.Group>
          <Button variant="primary" type="submit">
            Submit
          </Button>
        </Form>
        {resp.length <= 0 ? null : (
          <div className="resp-div">
            <h1>Results for {searchSystem}</h1>
            {/* <Table striped bordered hover>
              <thead>
                <tr>
                  <th>Time</th>
                  <th>ID</th>
                  <th>SE</th>
                  <th>Language</th>
                  <th>Location</th>
                  <th>Keyword</th>
                  <th>Tag</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>{resp.time}</td>
                  <td>{resp.tasks[0].id}</td>
                  <td>{resp.tasks[0].data.se}</td>
                  <td>{resp.tasks[0].data.language_name}</td>
                  <td>{resp.tasks[0].data.location_name}</td>
                  <td>{resp.tasks[0].data.keyword}</td>
                  <td>{resp.tasks[0].data.tag}</td>
                </tr>
              </tbody>
            </Table> */}
          </div>
        )}
      </Container>
    </div>
  );
}

export default ResultScreen;
